import React, {useState, useEffect} from "react";
import { OverlayTrigger, Tooltip } from "react-bootstrap";
import SVG from "react-inlinesvg";
import { toAbsoluteUrl } from "../../../../../../_metronic/_helpers";
import Switch from '@material-ui/core/Switch';

export function ActionsColumnFormatter (cellContent, row, rowIndex, { openViewPage, openEditPage }){
  const ccc = (event)=>{
  console.log(event.checked)
  }
  return(
    <>
    <OverlayTrigger
      overlay={<Tooltip id="products-edit-tooltip">{row.status}</Tooltip>}
    >
      <div
        className="btn btn-icon btn-sm mx-3"
      >
        <span className="svg-icon svg-icon-sm svg-icon-primary">
        <Switch id="F" color="secondary" value={row.status} onChange={(event) => ccc(event)}
        checked={row.status=="active"?true:false}
        />
        </span>
      
      </div>
    </OverlayTrigger>
  
    <OverlayTrigger
      overlay={<Tooltip id="products-edit-tooltip">Edit product</Tooltip>}
    >
      <a
        className="btn btn-icon btn-light btn-hover-primary btn-sm mx-3"
        onClick={() => openEditPage(row.id)}
      >
        <span className="svg-icon svg-icon-sm svg-icon-primary">
          <SVG
            src={toAbsoluteUrl("/media/svg/icons/project-svg/edit.svg")}
          />
        </span>
      </a>
    </OverlayTrigger>

    <> </>
    <OverlayTrigger
      overlay={<Tooltip id="products-edit-tooltip">View product details</Tooltip>}
    >
      <div
        className="btn btn-icon btn-light btn-hover-success btn-sm mx-3"
        onClick={() => openViewPage(row.id)}
      >
        <span className="svg-icon svg-icon-sm svg-icon-success">
          <SVG
             src={toAbsoluteUrl("/media/svg/icons/project-svg/blueview.svg")}
          />
        </span>
      </div>
    </OverlayTrigger>

  </>
   );
}
